const mainImg = new Image(); 
mainImg.src = 'data:image/png;base64,';

mainImg.addEventListener('load', function () {
    const canvas = document.getElementById('canvas1');
    const ctx = canvas.getContext('2d');
    canvas.width = 512;
    canvas.height = 512;

    ctx.drawImage(mainImg, 0, 0, canvas.width, canvas.height);
    // Return pixel information about color on canvas after scanning 
    const pixels = ctx.getImageData(0, 0, canvas.width, canvas.height);
    ctx.clearRect(0, 0, canvas.width, canvas.height);

    // Pixel particles system
    let particlesArray = [];
    const numberOfParticles = 5000;

    // Array for pixel brightness
    let mappedImage = [];
    // Loop through every pixel of 512px width
    for (let y = 0; y < canvas.height; y++){
        let row = [];
        for (let x = 0; x < canvas.width; x++) {
            const red = pixels.data[(y * 4 * pixels.width) + (x * 4)]; 
            const green = pixels.data[(y * 4 * pixels.width) + (x * 4 + 1)]; 
            const blue = pixels.data[(y * 4 * pixels.width) + (x * 4 + 2)]; 
            // hoisting
            const brightness = calculateRelativeBrightness(red, green, blue);
            const cell = [
                cellBrightness = brightness, 
            ];
            row.push(cell);
        }
        mappedImage.push(row);
    }

    // Utility function to adjust colors based on human brightness perception
    function calculateRelativeBrightness(red, green, blue) {
        return Math.sqrt(
            (red * red) * 0.299 +
            (green * green) * 0.587 +
            (blue * blue) * 0.114
        )/100;
    }

    // 5000 similar data objects for the particles array
    class Particle {
        constructor() {
            this.x = Math.random() * canvas.width;
            this.y = 0;
            // Particle speed determined by darkness of particle itself (dark = faster, light = slower)
            this.speed = 0;
            // Provides randomness in size and speed
            this.velocity = Math.random() * 0.8;
            this.size = Math.random() * 0.5 + 0.5;
            // Round down position to ensure no decimal points
            this.position1 = Math.floor(this.y);
            this.position2 = Math.floor(this.x);
        }
        // Reset particle position after they fall completely
        update() {
            this.position1 = Math.floor(this.y);
            this.position2 = Math.floor(this.x);
            this.speed = mappedImage[this.position1][this.position2][0];
            let movement = (2.5 - this.speed) + this.velocity;

            this.y += movement;
            if (this.y >= canvas.height) {
                this.y = 0;
                this.x = Math.random() * canvas.width;
            }
        }
        // Circle to represent each particle
        draw() {
            ctx.beginPath();
            ctx.fillStyle = 'white';
            ctx.arc(this.x, this.y, this.size, 0, Math.PI * 2);
            ctx.fill();
        }
    }

    // Initialize function for loop for 5000 particles to run
    function init() {
        for (let i = 0; i < numberOfParticles; i++) {
            particlesArray.push(new Particle());
        }
    }
    init();

    // Main animation loop
    function animate() {
        ctx.globalAlpha = 0.05;
        ctx.fillStyle = 'rgb(0,0,0)';
        ctx.fillRect(0, 0, canvas.width, canvas.height);
        ctx.globalAlpha = 0.2;
        for (let i = 0; i < particlesArray.length; i++) {
            particlesArray[i].update();
            ctx.globalAlpha = particlesArray[i].speed * 0.5;
            particlesArray[i].draw();
        }
        requestAnimationFrame(animate);
    }
    animate();
});
